/*View structure for view все счета */

/*!50001 DROP TABLE IF EXISTS `все счета` */;
/*!50001 DROP VIEW IF EXISTS `все счета` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `все счета` AS (select `divisions`.`code` AS `code_1`,`divisions`.`name_address` AS `name_address`,`accounts`.`code` AS `code`,`accounts`.`id_accounts_cat` AS `id_accounts_cat`,`n_currency`.`name` AS `name`,`n_accounts_cat`.`name` AS `name_acounts_cat` from (((`divisions` join `accounts`) join `n_currency`) join `n_accounts_cat`) where ((`divisions`.`id` = `accounts`.`id_divisions`) and (`n_currency`.`id` = `accounts`.`id_currency`) and (`n_accounts_cat`.`id` = `accounts`.`id_accounts_cat`)) order by `accounts`.`id`) */;

