/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `действующие лимиты мхб` AS (select `divisions`.`code` AS `code_1`,`divisions`.`name_address` AS `name_address`,`accounts`.`code` AS `code`,`limits`.`limit` AS `limit`,`n_currency`.`name` AS `name` from (((`divisions` join `accounts`) join `n_currency`) join `limits`) where ((`divisions`.`id` = `accounts`.`id_divisions`) and (`accounts`.`id` = `limits`.`id_accounts`) and (`n_currency`.`id` = `accounts`.`id_currency`)) order by `divisions`.`id`) */;

